import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import GlobalStyle from '../src/styles/GlobalStyle';

ReactDOM.render(
  <React.StrictMode>
    <App />
    <GlobalStyle />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
